import React from "react";
import { ReactTyped } from "react-typed";
import { motion } from "framer-motion";
import JulienPhoto from "../assets/julien_photo.jpeg";

const Home = () => {
  return (
    <motion.div
      className="w-full min-h-screen px-4 pt-20 bg-gray-50 flex items-center"
      initial={{ opacity: 0 }}
      animate={{ opacity: 1 }}
      transition={{ duration: 0.5 }}
      exit={{ opacity: 0 }}
    >
      <div className="max-w-[1240px] mx-auto grid grid-cols-1 md:grid-cols-2 gap-8 items-center">

        {/* Main Text Content */}
        <div className="flex flex-col justify-center items-center md:items-start text-center md:text-left">
          <ReactTyped
            className="text-3xl md:text-5xl font-bold text-center md:text-left text-gray-800"
            strings={["Hey, I'm Julien"]}
            typeSpeed={120}
            backSpeed={140}
            startDelay={600}
            loop
          />
          <h1 className="text-lg md:text-2xl font-bold py-4 text-gray-500">
            Computer Science Student at Northeastern University
          </h1>
        </div>

        {/* Image */}
        <div className="flex justify-center md:justify-end">
          <img
            className="w-48 h-48 md:w-96 md:h-96 rounded-full aspect-square hover:scale-110 transition-transform duration-300"
            src={JulienPhoto}
            alt="JulienPhoto"
          />
        </div>
      </div>
    </motion.div>
  );
};

export default Home;
